import { Link } from "react-router-dom";

const Cadastro = () => {
  return (
    <>
      <Link to="/cadastro/formulario">Surdo</Link>
      <Link to="/cadastro/formulario">Interprete</Link>
    </>
  );
};

export default Cadastro;
